import {GetRotatedBase64PNGFromBase64PNGLabel, GetSeparatePDFLabelDocument, GetSeparateZPLLabelDocument} from '../../src';

import {compareImages, createDirectory, savePDFFile} from '../../src/helpers/compare-labels';

describe('Rotate label base implementation', function () {

  test('Test rotating PNG label', async () => {
    const result = await GetRotatedBase64PNGFromBase64PNGLabel(BASE_64_PNG_LABEL, 90);

    expect(result).toBe(BASE_64_PNG_LABEL_ROTATED);
  });

});

describe('Split multi label implementation for PDF', function () {

  test('Test splitting PDF label', async () => {
    const separateLabels = await GetSeparatePDFLabelDocument(BASE_64_PDF_MULTI_LABEL);
    const labelsDirectory = 'labels';
    createDirectory(labelsDirectory);

    await savePDFFile(separateLabels[0], `${labelsDirectory}/firstGeneratedLabel`);
    await savePDFFile(separateLabels[1], `${labelsDirectory}/secondGeneratedLabel`);

    await savePDFFile(BASE_64_PDF_FIRST_SEPERATED_LABEL, `${labelsDirectory}/firstExpectedOutput`);
    await savePDFFile(BASE_64_PDF_SECOND_SEPERATED_LABEL, `${labelsDirectory}/secondExpectedOutput`);

    const numDiffPixelsFirstLabel = await compareImages(`${labelsDirectory}/firstExpectedOutput.pdf`, `${labelsDirectory}/firstGeneratedLabel.pdf`);
    const numDiffPixelsSecondLabel = await compareImages(`${labelsDirectory}/secondExpectedOutput.pdf`, `${labelsDirectory}/secondGeneratedLabel.pdf`);

    expect(numDiffPixelsFirstLabel).toBe(0);
    expect(numDiffPixelsSecondLabel).toBe(0);

  });
});

describe('Split multi label implementation for ZPL', function () {

  test('Test splitting ZPL label', () => {
    const result = GetSeparateZPLLabelDocument(BASE_64_ZPL_MULTI_LABEL);

    expect(result[0]).toBe(BASE_64_ZPL_FIRST_SEPERATED_LABEL);
    expect(result[1]).toBe(BASE_64_ZPL_SECOND_SEPERATED_LABEL);
  });
});

